import React from "react";
import { Link } from "react-router-dom";

function Logo() {
    return (
        <Link to="/" className="logo">
            <img id="logo" src="../images/logo.png" width="120" height="80" alt="michael scales logo" />
        </Link>

    );
}

export default Logo;
